Our Client

We are partnered with an award-winning industry superannuation fund with a deep 25 plus year history. Our clients goal is for members to achieve the best possible retirement outcome they can.¬†

This newly created Segment Insights Manager role will be responsible for developing and executing strategies to enhance member experience across their core member segments.¬†

Key Responsibilities:

Lead the development of member-centric experience strategies;
Lead the development and rollout of a VOC program to capture real-time feedback from members;
Facilitate cross-functional workshops to map current and future-state experiences across key touchpoints;
Create dashboards and insight reports that track member trends, engagement, retention, and campaign effectiveness
Key Requirements:

Solid experience in customer experience, member or marketing strategy, ideally within superannuation or financial services;
Demonstrated ability to synthesise complex data into actionable insights and strategic recommendations;
Strong understanding of customer segmentation, journey mapping, and persona development;
Curious, collaborative, and member-focused, with a passion for driving business impact through insights AND
Excellent stakeholder engagement and communication skills, with the ability to influence decisions at senior levels.¬†
This is a unique opportunity to build an enhanced member experience from the ground up, offering significant career growth potential within an industry superannuation fund.

If you are interested in applying, please apply directly to the link or by contacting Julia Thorpe on 0412-123-543.
